insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(1,'Эспрессо',10.00,100,'Терпкий, немного резкий аромат этого чёрного кофе и сильный, с мягкой горечью, вкус, в один момент взбодрят и поставят на ноги любого');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(2,'Эспрессо Макиато',12.00,100,'Лёгкая горчинка крепкого эспрессо в сочетании с нежной, лёгкой молочной пенкой, создают непревзойдённую вкусовую гамму.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(3,'Эспрессо Кон Панна',12.00,100,'Этот кофейный шедевр обладает сладким ароматом с целым букетом оттенков.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(4,'Американо',10.00,100,'Этот напиток в первую очередь пришелся по вкусу жителям Северной Америки, отчего и получил свое название. Меньше кофеина, больше кофейного удовольствия!');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(5,'Латтэ',15.00,100,'В горячее молоко добавляют свежеприготовленный ароматный кофе и все это венчает пышная молочная пена.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(6,'Ягодный чай',13.00,250,'Выбери свой любимый вкус Ягодного чая - клюква, облепиха или ягодный микс!');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(7,'Мятный чай с мёдом и корицей',15.00,250,'Мятный чай с мёдом и корицей — самое ароматное сочетание полезного и вкусного! Бодрит, активизирует и поднимает настроение!');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(8,'Черный чай',10.00,250,'Чашечка чая — это не только предлог для встречи. Это ещё и крепкий, бодрящий, утоляющий жажду и успокаивающий нервы напиток.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(9,'Гарячий шоколад',18.00,250,'Густой, сладкий шоколад так приятно есть по ложечке, растягивая удовольствие.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(10,'Смузи',23.00,400,'Это не просто фруктовый коктейль. Это густая и яркая смесь из взбитых фруктов и ягод.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(11,'Холодный чай',20.00,250,'Приятный напиток полон антиоксидантов, которые помогут сохранить красоту и молодость.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(12,'Лимонад',20.00,400,'«Лимонад» — традиционный напиток нашего детства.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(13,'Безалкогольный Мохито',25.00,250,'Свежая мята, что венчает горку измельченного в шейкере льда, и капельки воды, выступившие на стенках бокала, делают Мохито еще более крутым и желанным.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(14,'Шейк',25.00,400,'Так и хочется одним духом выпить этот густой, взбитый молочный шейк, а потом утереть рукавом молочные «усы» и расплыться в широкой искренней улыбке.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(15,'Cherry Cake',25.00,300,'Кисловато-сладкая вишня в сочетании с воздушными прослойками шоколадного и молочного суфле создают неповторимый вкус Cherry Сake.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(16,'ШокоМан',25.00,300,'Лёгкая, нежирная кексовая основа, пропитанная кремовым конфитюром и сдобренная шоколадной помадкой, становится очень мягкой и нежной.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(17,'Тирамису',25.00,300,'На мягкой бисквитной основе расположился воздушный мусс из сливочного итальянского сыра маскарпоне с вкраплениями бодрящего ликера и ароматного кофе.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(18,'Наполеон',25.00,300,'Это в меру сладкое угощение состоит из множества хрустящих коржей, щедро пропитанных сливочным кремом.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(19,'Вишневый штрудель',25.00,300,'Очень нежный и приятный десерт восхищает сочной вишнёвой начинкой, завёрнутой в рассыпчатое тонкое тесто в виде рулета.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(20,'Круассан',25.00,300,'Пышный и воздушный круассан с нежно-золотистой корочкой, что крошится от первого прикосновения губ, - прекрасное дополнение к утренней чашке кофе!');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(21,'Десерт клубничный',25.00,300,'Самая крупная, сладкая и сочная клубничка попала в этот лёгкий десерт.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(22,'Коффейный десерт',30.00,300,'Изысканная горка взбитых сливок высится на шоколадном бисквитном суфле — настоящее объедение, которое тает во рту, словно молочная пена.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(23,'Мохито',35.00,350,'Этот кубинский коктейль с мятой, лимоном, содовой и светлым ромом доставит наслаждение своим необычным вкусом.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(24,'Текила Санрайз',40.00,350,'Приятно утоляет жажду и вызывает возбуждающий прилив безудержной энергии.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(25,'Джин-тоник',45.00,350,'Вкус этого тонизирующего коктейля, словно бомба, взрывается после первого же глотка.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(26,'Голубая Лагуна',40.00,300,'Если жаждете острых ощущений, то Голубая лагуна вам их подарит сполна.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(27,'Черри Бренди',45.00,300,'Ярко выраженный сладковатый вкус вишни в этом лонг дринке делает его неповторимым.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(28,'Ром-кола',40.00,350,'Приятный, сладковатый, слегка газированный напиток утолит жажду и укрепит компанейский дух.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(29,'Глинтвейн',35.00,350,'Согреться после длительной прогулки и насладиться сладковато-пряным вкусом горячего вина можно в уютной обстановке кафе "Кафедра".');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(30,'Крем-суп с курицей',45.00,250,'Горячий и ароматный супчик с куриным филе и овощами избавит от гнетущего чувства голода и придется по вкусу даже ребёнку.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(31,'Салат "Скандинавский" с лососем',35.00,250,'Сочетание ломтиков лосося и перепелиных яиц в этом салате наполнит Ваш организм энергией и такими важными для здоровья жирными кислотами, минералами и микроэлементами.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(32,'Салат "Нисуаз" с тунцом',35.00,300,'Один из самых известных французских салатов представляет собой аппетитное сочетание приготовленных и свежих ингредиентов с полезными белками, содержащимися в тунце и яйцах.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(33,'Салат "Цезарь" с пармизаном',36.00,350,'Существует много различных вариантов рецепта этого знаменитого салата, но наше кафе готовит для своих гостей самый вкусный и полезный из них.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(34,'Салат "Греческий" с брынзой',38.00,350,'Нежный и сочный салат из свежих помидоров черри, хрустящих огурчиков, болгарского перца, листьев салата и пекинской капусты с кусочками брынзы идеально подходит для легкого перекуса в любое время дня.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(36,'Сендвич с индейкой и салатом',40.00,250,'Пышная булочка, посыпанная кунжутом, с начинкой из кусочков свежей сочной индейки и листа салата способна пополнить ваш запас энергии и сил.');
insert into DISH(DISH_ID,NAME,PRICE,WEIGHT,DESCRIPTION)values(37,'Апельсиновый фреш',25.00,400,'Кисло-сладкий фреш в один момент справится с жаждой, снимет усталость и поднимет настроение.');
